import React, { useEffect } from "react";
import { connect } from "react-redux";

import Container from "@material-ui/core/Container";

import Spinner from "../../components/spinner/spinner";
import ClassificadoList from "../../components/classificado-list/classificado-list";

import { fetchClassificadosStart } from "../../redux/classificado/classificado.actions";

const Homepage = ({ fetchClassificadosStart }) => {
  useEffect(() => {
    fetchClassificadosStart();
  }, [fetchClassificadosStart]);

  return (
    <div className="homepage">
      <Container maxWidth="sm">
        <h2>Classificados</h2>
        <ClassificadoList />
      </Container>
    </div>
  );
};

const mapDispatchToProps = (dispatch) => ({
  fetchClassificadosStart: () => dispatch(fetchClassificadosStart()),
});

export default connect(null, mapDispatchToProps)(Homepage);
